async () => {
  try {
    console.log("starting");
    await Select_Raw_Scaling.run();
    const scale_data = Select_Raw_Scaling.data;
    console.log("got raw scaling");
    await Logs.run();
    console.log("logs loaded");
    const log_set = new Set(Logs.data.map(item => item.Log));
    console.log("got Logs");
    await ILogs.run();
    const ilog_set = new Set(ILogs.data.map(item => item.Log));
    console.log("got ILogs");
    await RLogs.run();
    const rlog_set = new Set(RLogs.data.map(item => item.Log));
    console.log("got RLogs");
    await Lengths.run();
    const len_set = new Set(Lengths.data.map(item => item.Lengths));
    console.log("got Lengths");
    await Dockets.run();
    const docket_set = new Set(Dockets.data.map(item => item.Docket));
    console.log("got Dockets");
    await Grade.run();
    const grade_set = new Set(Grade.data.map(item => item.Grade));
    console.log("got Grades");
    await Location.run();
    const location_set = new Set(Location.data.map(item => item.Location));
    console.log("got Locations");
    const new_Location = new Set();
    const new_Location_Added = {};
    console.log("data loaded");
    const {iv_scale, scale, reject} = scale_data.reduce((acc, sr) => {
      const invalid = reason => {
        if (!ilog_set.has(sr.Log)) {
          sr.Reason += reason;
          acc.iv_scale.push([sr.Log, sr.Docket, sr.Grade, sr.Length, sr.Diameter, sr.JAS, sr.Location, sr.Date, sr.Reason]);
        }
      };
      const valid = () => acc.scale.push([sr.Log, sr.Docket, sr.Grade, sr.Length, sr.Diameter, sr.JAS, sr.Location, sr.Date]);
      const reject = () => {
        if (!rlog_set.has(sr.Log)) {
          acc.reject.push([sr.Log, sr.Docket, sr.Grade, sr.Length, sr.Diameter, sr.JAS, sr.Date, sr.Reason]);
        }
      };
      sr.Log = parseInt(sr.Log.replace(/\D/g, ''));
      if (!log_set.has(sr.Log)) {
        sr.Date = sr.Date.split('-').reverse().join("-");
        sr.Location = sr.Location.replace(/ /g, '').toUpperCase();
        sr.Location = sr.Location.slice(0, 4) + " " + sr.Location.slice(-3);
        if (!location_set.has(sr.Location) && sr.Location && sr.Location != 'TEST' && sr.Location != 'REJE TED') {
          new_Location.add(sr.Location);
          new_Location_Added[sr.Location] = sr.Date;
          location_set.add(sr.Location);
        }
        if (isNaN(sr.Docket)) {
          invalid(" Invalid Docket Format");
        } else if (!docket_set.has(parseInt(sr.Docket))) {
          invalid(" Docket Not Found");
        } else if (sr.Status === 'Rejected') {
          reject();
        } else if (!location_set.has(sr.Location) || sr.Location === 'TEST') {
          invalid(" Invalid Location");
        } else if (sr.Diameter < 16 || sr.Diameter > 50 || isNaN(sr.Diameter)) {
          invalid(' Diameter out of range or NaN');
        } else if (!len_set.has(sr.Length.toString())) {
          invalid(" Invalid Length", sr.Length);
        } else if (!grade_set.has(sr.Grade)) {
          invalid(" Invalid Grade");
        } else {
          valid();
        }
      } else {
        showAlert("Duplicate Log " + sr.Log.toString(), 'error');
      }
      return acc;
    }, {
      scale: [],
      iv_scale: [],
      reject: []
    });
    console.log("finished processing");
    if (new_Location.size) {
      const location_data = Array.from(new_Location).map(item => `('${item}','','${new_Location_Added[item]}')`).join(',').replace(/''/g, 'NULL');
      Insert_Yard.run({
        'data': location_data
      }).then(() => showAlert("Inserted New Locations ${location_data}", 'success')).error(error => showAlert(error, 'error'));
      Location.run();
      console.log("Inserted Locations");
    }
    if (scale.length > 0) {
      const data = scale.map(item => `(${item.map(val => `'${val}'`).join(',')})`).join(',');
      console.log('Valid :', scale.length);
      Insert_VScaling.run({
        'data': data
      }).then(() => showAlert("Found Valid Scaling Entires", 'success')).catch(() => showAlert("Error in adding Valid", 'error'));
    }
    if (iv_scale.length > 0) {
      const idata = iv_scale.map(item => `(${item.map(val => `'${val}'`).join(',')})`).join(',');
      console.log('Invalid: ', iv_scale.length);
      Insert_Invalid_Scaling.run({
        'data': idata
      }).then(() => showAlert("Found Invalid Scaling Entires", 'success')).catch(() => showAlert("Error in adding invalid", 'error'));
    }
    if (reject.length > 0) {
      const rdata = reject.map(item => `(${item.map(val => `'${val}'`).join(',')})`).join(',');
      console.log('Rejects : ', reject.length);
      Insert_Reject_Scaling.run({
        'data': rdata
      }).then(() => showAlert("Found Reject Scaling Entires", 'success')).catch(() => showAlert("Error in adding reject", 'error'));
    }
    console.log("recounting totals");
    await VScaling.run();
    await IScaling.run();
    await RejectScaling.run();
    await Invalid_Dockets.run();
    Count_Scaling.run();
    return 'success';
  } catch (error) {
    showAlert("Processing Error", 'error');
    return Error();
  }
}

